INSERT INTO `sys_if_invoke_inbound` VALUES ('3', 'hap.invoke.apiname.interfacetranspond', '/r/api', '2017-08-03 15:54:39', 'sysName=Weather&apiName=SOAP&access_token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJhdWQiOlsiYXBpLXJlc291cmNlIl0sInVzZXJfbmFtZSI6IkFETUlOIiwic2NvcGUiOlsicmVhZCIsIndyaXRlIiwidHJ1c3QiXSwiZXhwIjoxNTAxNzQ5NzU3LCJhdXRob3JpdGllcyI6WyJST0xFX1VTRVIiLCJFTVBMT1lFRSIsIkFETUlOIl0sImp0aSI6IjA1NjllOTZlLWE1NWQtNDE2Ni05OTYxLWFjNWE5MzVhZGE2NCIsImNsaWVudF9pZCI6ImNsaWVudDIifQ.R4ZZBI_wFyKuqm1Z10ZsMulVnikcI8_Mgeh8O6kn76s', '{\"theCityName\":\"上海\"}', 'POST', 'success', '{\"soap:Envelope\":{\"@xmlns:soap\":\"http://schemas.xmlsoap.org/soap/envelope/\",\"@xmlns:xsi\":\"http://www.w3.org/2001/XMLSchema-instance\",\"@xmlns:xsd\":\"http://www.w3.org/2001/XMLSchema\",\"soap:Body\":{\"getWeatherbyCityNameResponse\":{\"getWeatherbyCityNameResult\":{\"string\":[\"直辖市\",\"上海\",\"58367\",\"58367.jpg\",\"2017-8-3 15:51:19\",\"29℃/36℃\",\"8月3日 晴转多云\",\"东南风4-5级\",\"0.gif\",\"1.gif\",\"今日天气实况：气温：36℃；风向/风力：东北风 1级；湿度：52%；紫外线强度：强。空气质量：良。\",\"紫外线指数：强，涂擦SPF大于15、PA+防晒护肤品。感冒指数：少发，感冒机率较低，避免长期处于空调屋中。穿衣指数：炎热，建议穿短衫、短裤等清凉夏季服装。洗车指数：较适宜，无雨且风力较小，易保持清洁度。运动指数：较不宜，请减少运动时间并降低运动强度。空气污染指数：良，气象条件有利于空气污染物扩散。\",\"28℃/36℃\",\"8月4日 多云\",\"南风微风\",\"1.gif\",\"1.gif\",\"28℃/35℃\",\"8月5日 小雨转阴\",\"东北风微风\",\"7.gif\",\"2.gif\",\"上海简称：沪，位置：上海地处长江三角洲前缘，东濒东海，南临杭州湾，西接江苏，浙江两省，北界长江入海，正当我国南北岸线的中部，北纬31°14′，东经121°29′。面积：总面积7823.5平方公里。人口：人口1000多万。上海丰富的人文资源、迷人的城市风貌、繁华的商业街市和欢乐的节庆活动形成了独特的都市景观。游览上海，不仅能体验到大都市中西合壁、商儒交融、八方来风的氛围，而且能感受到这个城市人流熙攘、车水马龙、灯火璀璨的活力。上海在中国现代史上占有着十分重要的地位，她是中国共产党的诞生地。许多震动中外的历史事件在这里发生，留下了众多的革命遗迹，处处为您讲述着一个个使人永不忘怀的可歌可泣的故事，成为包含民俗的人文景观和纪念地。在上海，每到秋祭，纷至沓来的人们在这里祭祀先烈、缅怀革命历史,已成为了一种风俗。大上海在中国近代历史中，曾是风起云涌可歌可泣的地方。在这里荟萃多少风云人物，散落在上海各处的不同住宅建筑，由于其主人的非同寻常，蕴含了耐人寻味的历史意义。这里曾留下许多革命先烈的足迹。瞻仰孙中山、宋庆龄、鲁迅等故居，会使您产生抚今追昔的深沉遐思，这里还有无数个达官贵人的住宅，探访一下李鸿章、蒋介石等人的公馆，可以联想起主人那段显赫的发迹史。\"]}}}}}', '277', null, '192.168.137.1', null, 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/60.0.3107.4 Safari/537.36', '1', '-1', '-1', '-1', '2017-08-03 15:54:38', '-1', '2017-08-03 15:54:38', '-1');
