INSERT INTO `sys_if_invoke_outbound` VALUES ('1', 'Weather-SOAP', 'http://www.webxml.com.cn/WebServices/WeatherWebService.asmx?op=getWeatherbyCityNameWeatherWebService.asmx', '2017-08-02 10:36:42', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<soap:Envelope xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:soap=\"http://schemas.xmlsoap.org/soap/envelope/\">\n  <soap:Body>\n    <getWeatherbyCityName xmlns=\"http://WebXml.com.cn/\"><theCityName>上海</theCityName>\n</getWeatherbyCityName>\n  </soap:Body>\n</soap:Envelope>', 'success', '{\"soap:Envelope\":{\"@xmlns:soap\":\"http://schemas.xmlsoap.org/soap/envelope/\",\"@xmlns:xsi\":\"http://www.w3.org/2001/XMLSchema-instance\",\"@xmlns:xsd\":\"http://www.w3.org/2001/XMLSchema\",\"soap:Body\":{\"getWeatherbyCityNameResponse\":{\"getWeatherbyCityNameResult\":{\"string\":[\"直辖市\",\"上海\",\"58367\",\"58367.jpg\",\"2017-8-2 10:18:45\",\"29℃/35℃\",\"8月2日 多云\",\"东南风3-4级\",\"1.gif\",\"1.gif\",\"今日天气实况：气温：31℃；风向/风力：东北风 1级；湿度：69%；紫外线强度：中等。空气质量：良。\",\"紫外线指数：中等，涂擦SPF大于15、PA+防晒护肤品。感冒指数：少发，感冒机率较低，避免长期处于空调屋中。穿衣指数：炎热，建议穿短衫、短裤等清凉夏季服装。洗车指数：较适宜，无雨且风力较小，易保持清洁度。运动指数：较不宜，天气炎热，建议停止高强度运动。空气污染指数：良，气象条件有利于空气污染物扩散。\",\"29℃/36℃\",\"8月3日 多云\",\"东南风3-4级转微风\",\"1.gif\",\"1.gif\",\"29℃/37℃\",\"8月4日 阴转多云\",\"东南风微风\",\"2.gif\",\"1.gif\",\"上海简称：沪，位置：上海地处长江三角洲前缘，东濒东海，南临杭州湾，西接江苏，浙江两省，北界长江入海，正当我国南北岸线的中部，北纬31°14′，东经121°29′。面积：总面积7823.5平方公里。人口：人口1000多万。上海丰富的人文资源、迷人的城市风貌、繁华的商业街市和欢乐的节庆活动形成了独特的都市景观。游览上海，不仅能体验到大都市中西合壁、商儒交融、八方来风的氛围，而且能感受到这个城市人流熙攘、车水马龙、灯火璀璨的活力。上海在中国现代史上占有着十分重要的地位，她是中国共产党的诞生地。许多震动中外的历史事件在这里发生，留下了众多的革命遗迹，处处为您讲述着一个个使人永不忘怀的可歌可泣的故事，成为包含民俗的人文景观和纪念地。在上海，每到秋祭，纷至沓来的人们在这里祭祀先烈、缅怀革命历史,已成为了一种风俗。大上海在中国近代历史中，曾是风起云涌可歌可泣的地方。在这里荟萃多少风云人物，散落在上海各处的不同住宅建筑，由于其主人的非同寻常，蕴含了耐人寻味的历史意义。这里曾留下许多革命先烈的足迹。瞻仰孙中山、宋庆龄、鲁迅等故居，会使您产生抚今追昔的深沉遐思，这里还有无数个达官贵人的住宅，探访一下李鸿章、蒋介石等人的公馆，可以联想起主人那段显赫的发迹史。\"]}}}}}', '409', null, null, '1', '-1', '-1', '-1', '2017-08-02 10:36:42', '-1', '2017-08-02 10:36:42', '-1');
